     number: timestamp,
   };
   const { data: [{ id: logInsertLinkId }] } = deep.insert(logInsertInsertData);
   deep.insert({
     type_id: containTypeLinkId,
     from_id: triggeredByLinkId,
     to_id: logInsertLinkId
   })

   const logIdInsertData = {
     type_id: deep.id("@deep-foundation/logger", "LogId"),
     from_id: logInsertLinkId,
     to_id: newLink.id,
    //  number: newLink.id,
     in: {
       data: {
         type_id: containTypeLinkId,
         from_id: logInsertLinkId,
       },
     },
   };
   const { data: [{ id: logIdLinkId }] } = deep.insert(logIdInsertData);
   deep.insert(logIdInsertData);
   deep.insert({
     type_id: containTypeLinkId,
     from_id: logInsertLinkId,
     to_id: logIdLinkId
   })

