   deep.insert(logIdInsertData);
   deep.insert({
     type_id: containTypeLinkId,
     from_id: logInsertLinkId,
     to_id: logTypeLinkId
   })

   if (newLink.from_id !== 0 && newLink.to_id !== 0) {
     const logFromInsertData = {
       type_id: deep.id("@deep-foundation/logger", "LogFrom"),
       from_id: logInsertLinkId,
       to_id: newLink.from_id,
