         data: {
           type_id: containTypeLinkId,
           from_id: logInsertLinkId,
         },
       },
     };
     const { data: [{ id: logFromLinkId }] } = deep.insert(logFromInsertData)
     deep.insert(logIdInsertData);
     deep.insert({
       type_id: containTypeLinkId,
       from_id: logInsertLinkId,
       to_id: logFromLinkId
     })

     const logToInsertData = {
       type_id: deep.id("@deep-foundation/logger", "LogTo"),
       from_id: logInsertLinkId,
       to_id: newLink.to_id,
       in: {
         data: {
           type_id: containTypeLinkId,
           from_id: logInsertLinkId,
         },
       },
     };
     const { data: [{ id: logToLinkId }] } = deep.insert(logToInsertData)
     deep.insert(logIdInsertData);
     deep.insert({
       type_id: containTypeLinkId,
       from_id: logInsertLinkId,
       to_id: logToLinkId
     })
   }

   const logAuthorLinkInsertData = {
     type_id: deep.id("@deep-foundation/logger", "LogAuthor"),
     from_id: logInsertLinkId,
     to_id: triggeredByLinkId,
     in: {
       data: {
         type_id: containTypeLinkId,
         from_id: logInsertLinkId,
       },
     },
   };
   const { data: [{ id: logAuthorLinkId }] } = deep.insert(logAuthorLinkInsertData)
   deep.insert(logIdInsertData);
   deep.insert({
     type_id: containTypeLinkId,
     from_id: logInsertLinkId,
